LIVE: Snow is falling in parts of the Northeast as a clipper system moves through just days before Christmas.

Some areas could wake up to a white Christmas, with travel impacts possible in New York and beyond.

@thekatiebyrne breaks down what to expect. https://t.co/DmJ7ftbl8c

